import React from 'react'

const SearchResult = ({ result }) => {
    return (
        <>
            <div class="container mb-3">
                <div class="row">
                    {result.length ? <small><strong>Search Results</strong></small> : <small><strong>No Search Result</strong></small>}
               
                </div>
            </div>
        </>
    )
}



export default SearchResult
